class BrokerUser:
    def __init__(self):
        self.user_stories = []

    def add_user_story(self, user_story):
        self.user_stories.append(user_story)

    def process_user_stories(self):
        for user_story in self.user_stories:
            print(f"Processing user story: {user_story.description}")
            if user_story.cluster == 4:
                user_story.process_deletions()
                user_story.redesign_resources_page()
                user_story.report_user_testing()
                user_story.sync_d1_file_generation()
                user_story.update_sql_codes()
                user_story.derive_funding_agency_code()
                user_story.map_federal_action_obligation()
                user_story.implement_ppopzip_validations()
            elif user_story.cluster == 5:
                user_story.move_on_to_round_2()
                user_story.add_gtas_window_data()
                user_story.update_fabs_sample_file()
            elif user_story.cluster == 1:
                user_story.access_raw_agency_published_files()
                user_story.manage_d_files_generation_requests()
            elif user_story.cluster == 3:
                user_story.ensure_deleted_fsrs_records_not_included()
            elif user_story.cluster == 2:
                user_story.derive_office_names_from_office_codes()
                user_story.link_sample_file_to_correct_file()
            elif user_story.cluster == 0:
                print("No specific actions for cluster 0")


